import { Route, Routes } from "react-router-dom";
import ModuleListing from "./component/modules/ModuleListing";
import Sidebar from "./component/navcomponent/sidebar";

function App() {
  return (
    <>
        <Route element={<Sidebar />} />
        <Route element={<ModuleListing />} />
    </>
  );
}

export default App;
